/*==============================================================*/
/* Table: ASIGNACION                                            */
/*==============================================================*/
create table ASIGNACION 
(
   ID_CARRO             INTEGER              not null,
   ID_COMPRA            INTEGER              not null,
   constraint PK_ASIGNACION primary key (ID_CARRO, ID_COMPRA)
);

/*==============================================================*/
/* Table: CAJA                                                  */
/*==============================================================*/
create table CAJA 
(
   ID_CAJA              INTEGER              not null,
   POSICION_X_CAJA      DECIMAL              not null,
   POSICION_Y_CAJA      DECIMAL              not null,
   constraint PK_CAJA primary key (ID_CAJA)
);

/*==============================================================*/
/* Table: CARROS_COMPRAS                                        */
/*==============================================================*/
create table CARROS_COMPRAS 
(
   ID_CARRO             INTEGER              not null,
   POSICION_X_CARRO     DECIMAL              not null,
   POSICION_Y_CARRO     DECIMAL              not null,
   constraint PK_CARROS_COMPRAS primary key (ID_CARRO)
);

/*==============================================================*/
/* Table: CELDA_GONDOLA                                         */
/*==============================================================*/
create table CELDA_GONDOLA 
(
   ID_CELDA             INTEGER              not null,
   ID_PRODUCTO          INTEGER,
   ID_GONDOLA           INTEGER              not null,
   COLUMNA_CELDA        INTEGER              not null,
   FILA_CELDA           INTEGER              not null,
   CANTIDAD_PRODUCTO_CELDA INTEGER              not null,
   constraint PK_CELDA_GONDOLA primary key (ID_CElDA)
);

/*==============================================================*/
/* Table: CLIENTE                                               */
/*==============================================================*/
create table CLIENTE
(
   ID_CLIENTE           INTEGER              not null,
   NOMBRE_CLIENTE       VARCHAR2(50)         not null,
   APELLIDO_CLIENTE     VARCHAR2(50)         not null,
   CORREO_ELECTRONICO_CLIENTE VARCHAR2(60)         not null,
   TELEFONO_CLIENTE     INTEGER,
   constraint PK_CLIENTE primary key (ID_CLIENTE)
);

/*==============================================================*/
/* Table: COMPRA                                                */
/*==============================================================*/
create table COMPRA 
(
   ID_COMPRA            INTEGER              not null,
   ID_FACTURA           INTEGER,
   ID_CLIENTE           INTEGER              not null,
   constraint PK_COMPRA primary key (ID_COMPRA)
);

/*==============================================================*/
/* Table: DESEOS_PRODUCTOS                                      */
/*==============================================================*/
create table DESEOS_PRODUCTOS 
(
   ID_LISTADESEO        INTEGER              not null,
   ID_PRODUCTO          INTEGER              not null,
   constraint PK_DESEOS_PRODUCTOS primary key (ID_LISTADESEO, ID_PRODUCTO)
);

/*==============================================================*/
/* Table: DETALLES                                              */
/*==============================================================*/
create table DETALLES 
(
   ID_DETALLE           INTEGER              not null,
   ID_PRODUCTO          INTEGER              not null,
   ID_COMPRA            INTEGER              not null,
   CANTIDAD_PRODUCTO    INTEGER              not null,
   constraint PK_DETALLES primary key (ID_DETALLE)
);

/*==============================================================*/
/* Table: FACTURAS                                              */
/*==============================================================*/
create table FACTURAS 
(
   ID_FACTURA           INTEGER              not null,
   ID_COMPRA            INTEGER              not null,
   ID_CAJA              INTEGER              not null,
   FECHA_FACTURA        TIMESTAMP            not null,
   VALOR_PAGO_FACTURA   NUMBER               not null,
   constraint PK_FACTURAS primary key (ID_FACTURA)
);

/*==============================================================*/
/* Table: GONDOLAS                                              */
/*==============================================================*/
create table GONDOLAS 
(
   ID_GONDOLA           INTEGER              not null,
   NIVELES_GONDOLA      INTEGER              not null,
   POSICION_X_GONDOLA   DECIMAL              not null,
   POSICION_Y_GONDOLA   DECIMAL              not null,
   constraint PK_GONDOLAS primary key (ID_GONDOLA)
);

/*==============================================================*/
/* Table: LISTADESEOS                                           */
/*==============================================================*/
create table LISTADESEOS 
(
   ID_LISTADESEO        INTEGER              not null,
   ID_CLIENTE           INTEGER              not null,
   FECHA_GENERADA       DATE                 not null,
   constraint PK_LISTADESEOS primary key (ID_LISTADESEO)
);

/*==============================================================*/
/* Table: MARCAS                                                */
/*==============================================================*/
create table MARCAS 
(
   ID_MARCA             INTEGER              not null,
   NOMBRE_MARCA         VARCHAR2(20)         not null,
   constraint PK_MARCAS primary key (ID_MARCA)
);

/*==============================================================*/
/* Table: PRODUCTOS                                             */
/*==============================================================*/
create table PRODUCTOS 
(
   ID_PRODUCTO          INTEGER              not null,
   ID_MARCA             INTEGER              not null,
   NOMBRE_PRODUCTO      VARCHAR2(50)         not null,
   PRECIO_PRODUCTO      INTEGER              not null,
   DESCRIPCION_PRODUCTO VARCHAR2(1024)       not null,
   FECHAVENCIMIENTO_PRODUCTO DATE,
   TIPO_PRODUCTO        VARCHAR2(2)       not null
   constraint CKC_TIPO_PRODUCTO_PRODUCTO check (TIPO_PRODUCTO in ('B'/*Bebidas*/,'C'/*Comidas*/,'A'/*Aseo*/,'T'/*Tecnología*/,'BE'/*Belleza*/,'CA'/*Calzado*/,'LI'/*Licor*/,'R'/*ROPA*/,'M'/*MEDICINA*/,'H'/*Hogar*/)),
   CANTIDAD_PRODUCTO    INTEGER              not null,
   MEDIDA_PRODUCTO      VARCHAR2(2)       not null
      constraint CKC_MEDIDA_PRODUCTO_PRODUCTO check (MEDIDA_PRODUCTO in ('G'/*Gramos*/,'ML'/*Mililitros*/,'KG'/*Kilogramos*/,'L'/*Litros*/,'M'/*Metros*/,'CM'/*Centimetros*/,'U'/*Unidades*/,'P'/*Pulgadas*/)),
   CANTIDAD_MEDIDA_PRODUCTO NUMBER               not null,
   constraint PK_PRODUCTOS primary key (ID_PRODUCTO)
);

alter table ASIGNACION
   add constraint FK_ASIGNACI_CARRO_COM_CARROS_C foreign key (ID_CARRO)
      references CARROS_COMPRAS (ID_CARRO);

alter table ASIGNACION
   add constraint FK_ASIGNACI_CARRO_COM_COMPRA foreign key (ID_COMPRA)
      references COMPRA (ID_COMPRA);

alter table CELDA_GONDOLA
   add constraint FK_CELDA_GO_CELDA_GON_GONDOLAS foreign key (ID_GONDOLA)
      references GONDOLAS (ID_GONDOLA);

alter table CELDA_GONDOLA
   add constraint FK_CELDA_GO_PRODUCTO__PRODUCTO foreign key (ID_PRODUCTO)
      references PRODUCTOS (ID_PRODUCTO);

alter table COMPRA
   add constraint FK_COMPRA_CLIENTE_C_CLIENTE foreign key (ID_CLIENTE)
      references CLIENTE (ID_CLIENTE);

alter table COMPRA
   add constraint FK_COMPRA_FACTURAS__FACTURAS foreign key (ID_FACTURA)
      references FACTURAS (ID_FACTURA);

alter table DESEOS_PRODUCTOS
   add constraint FK_DESEOS_P_DESEOS_PR_LISTADES foreign key (ID_LISTADESEO)
      references LISTADESEOS (ID_LISTADESEO);

alter table DESEOS_PRODUCTOS
   add constraint FK_DESEOS_P_DESEOS_PR_PRODUCTO foreign key (ID_PRODUCTO)
      references PRODUCTOS (ID_PRODUCTO);

alter table DETALLES
   add constraint FK_DETALLES_DETALLES__COMPRA foreign key (ID_COMPRA)
      references COMPRA (ID_COMPRA);

alter table DETALLES
   add constraint FK_DETALLES_DETALLES__PRODUCTO foreign key (ID_PRODUCTO)
      references PRODUCTOS (ID_PRODUCTO);

alter table FACTURAS
   add constraint FK_FACTURAS_CAJA_FACT_CAJA foreign key (ID_CAJA)
      references CAJA (ID_CAJA);

alter table FACTURAS
   add constraint FK_FACTURAS_FACTURAS__COMPRA foreign key (ID_COMPRA)
      references COMPRA (ID_COMPRA);

alter table LISTADESEOS
   add constraint FK_LISTADES_DESEOS_CL_CLIENTE foreign key (ID_CLIENTE)
      references CLIENTE (ID_CLIENTE);

alter table PRODUCTOS
   add constraint FK_PRODUCTO_MARCA_PRO_MARCAS foreign key (ID_MARCA)
      references MARCAS (ID_MARCA);


